def save_file(dirname, file, is_random=True, select_path=1):
    """
    兼容之前的代码，待修改
    :param select_path: 选择存储路径， 默认选择1，路径为FILE_UPLOAD_PATH
    :param dirname: 文件夹名称
    :param file: 文件
    :param is_random: 文件名是否混编
    :return:
    """
    # 存储合同文件
    if is_random:
        filename = random_filename(file.filename)
    else:
        filename = file.filename
    if select_path == 1:
        upload_path = os.path.join(current_app.config['FILE_UPLOAD_PATH'], dirname)
    else:
        upload_path = os.path.join(current_app.config['FILE_UPLOAD_PATH2'], dirname)
    # 没有文件夹则创建文件夹
    if not os.path.exists(upload_path):
        os.makedirs(upload_path)
    file.save(os.path.join(upload_path, filename))
    return filename


def is_exist_file(dir_path, file):
    """
    判断文件系统中是否存在改文件
    :param dir_path: 路径
    :param file: 文件
    :return:
    """
    upload_path = os.path.join(current_app.config['FILE_UPLOAD_PATH'], dir_path)
    full_path = os.path.join(upload_path, file.filename)
    return os.path.exists(full_path)


def random_filename(filename):
    # 处理文件名，防止系统文件被篡改
    ext = os.path.splitext(filename)[1]
    new_filename = uuid.uuid4().hex + ext
    return new_filename


def make_dirnames(full_path, dirnames):
    os.makedirs(full_path)
    for dirname in dirnames:
        path = os.path.join(full_path, dirname)
        os.makedirs(path)


def delete_file(filepath, filename, delete_type=1):
    """
    根据文件路径删除文件
    by:df
    """
    if delete_type == 1:
        file_path = os.path.join(current_app.config['FILE_UPLOAD_PATH'], filepath)
    else:
        file_path = os.path.join(current_app.config['FILE_UPLOAD_PATH2'], filepath)

    ret = True
    try:
        os.remove(file_path + "/" + filename)
    except FileNotFoundError as e:
        logging.warning(e)
        ret = False
    except PermissionError as e:
        logging.warning(e)
        ret = False
    return ret


