def timestamp2string(timestamp):
    """
    将时间戳改为了形如2020-01-01 12:01:01的格式
    :param timestamp: 时间戳
    :return: 文本
    """
    t = time.localtime(timestamp)
    text = time.strftime('%Y-%m-%d %H:%M:%S', t)
    return text


def get_files_stat_by_dir(path):
    """
    获取文件的具体信息
    :param path:
    :return:
    """
    file_path = os.path.join(current_app.config['FILE_UPLOAD_PATH'], path)
    # 没有此文件路径则创建文件夹
    if not os.path.exists(file_path):
        os.makedirs(file_path)
    file_list = os.listdir(file_path)
    results = []
    for filename in file_list:
        result = os.stat(os.path.join(file_path, filename))
        # 字节 转成KB或者MB
        results.append({
            'name': filename,
            'ctime': timestamp2string(result.st_ctime),
            'mtime': timestamp2string(result.st_mtime),
            'size': result.st_size
        })
    return results


def get_base64_code(filename):
    """
    返回图片的base64编码
    :param filename:
    :return:
    """
    upload_path = current_app.config["FILE_UPLOAD_PATH"]
    file_path = os.path.join(upload_path, "avatar", filename)
    try:
        with open(file_path, 'rb') as f:
            img_data = f.read()
            base64_data = base64.b64encode(img_data)
            # 如果想要在浏览器上访问base64格式图片，需要在前面加上：data:image/jpeg;base64,
            return base64_data.decode("gbk")
    # 用户默认头像
    except Exception:
        return """"""


def readxlsx(dirname, file):
    """
    读取xlsx文件
    return:[[1,2,3,...],...]
    by:df
    """
    filename = random_filename(file.filename)
    upload_path = os.path.join(current_app.config['FILE_UPLOAD_PATH'], dirname)
    # 没有文件夹则创建文件夹
    if not os.path.exists(upload_path):
        os.makedirs(upload_path)
    file.save(os.path.join(upload_path, filename))
    file_path = os.path.join(upload_path, filename)
    data = pd.read_excel(file_path,  skiprows=0, keep_default_na=False)
    temp = np.array(data)
    temp = temp.tolist()
    result = []
    for i in temp:
        if i not in result:
            result.append(i)
    return result


def get_map_data(filename):
    """根据文件名获取对应的地图数据"""
    path = os.path.join(basedir, 'web', 'static', 'mapdata')
    # 读取文件，若没有文件则返回空
    try:
        with open(os.path.join(path, filename), 'r', encoding='utf-8') as fp:
            map_data = json.load(fp)
    except FileNotFoundError as e:
        map_data = None
    return map_data


def readpdf(dirname, file):
    """
    读取pdf文件
    return:[[1,2,3,...],...]
    by:df
    """
    filename = random_filename(file.filename)
    upload_path = os.path.join(current_app.config['FILE_UPLOAD_PATH'], dirname)
    # 没有文件夹则创建文件夹
    if not os.path.exists(upload_path):
        os.makedirs(upload_path)
    file.save(os.path.join(upload_path, filename))
    file_path = os.path.join(upload_path, filename)
    pdf = pdfplumber.open(file_path)
    temp = []
    result_table = []
    for item in range(len(pdf.pages)):
        page = pdf.pages[item]
        table = page.extract_tables()
        temp.extend(table)
    for i in temp:
        result_table.extend(i)
    return result_table


def read_json_data(filename, encoding='utf-8'):
    """
    读取json文件，并返回数据
    :param filename: 文件路径
    :param encoding: 编码
    :return: dict
    """
    fp = open(filename, 'r', encoding=encoding)
    json_data = json.load(fp)
    fp.close()
    return json_data
